import React from 'react'
import { Link } from 'react-router-dom'

import styled from 'styled-components'

const items = [
{
  title: 'textiles',
  link: '/textiles'
}, {
  title: 'cermaics',
  link: '/ceramics'
},
{
  title: 'prints',
  link: 'prints'
}]

const StyledHeader = styled.ul`
  display: flex;
  align-items: center;
  justify-content: space-between;
  list-style: none;
  margin: 0;
  padding: 0;
`

const Header = (props) => {
  return (
    <StyledHeader class="header-container">  
      { items.map(elem => {
          <li> 
            <Link to='{ elem.link }'> { elem.title }</Link>
          </li> 
        })
      }
    </StyledHeader>
  )
}

export default Header
